import React from "react";
function PopupWithForm(props) {

    return (
            <div className={props.isOpen ? `popup popup_type_${props.name}` : `popup`}  >
                <div className="menu">
                    <button className="menu__close-icon close-icon" type="button" />
                    <h2 className="menu__title">{props.title}</h2>
                    <form className="form" noValidate="" name={`${props.name}`}>
                        {props.child}
                    </form>
                </div>
            </div>


    )
}

export default PopupWithForm
